import { useEffect } from "react";
import "../scss/ban.css";
import $ from "jquery";

export default function Circle(){

    function chg_page() {
        $(this).toggleClass("on")
    }

    // useEffect(()=>{
    //     const circle = $(".album_set").on("click", chg_page);
    // },[])
    useEffect(()=>{
        const albumSetElement = $(".album_set");
        albumSetElement.on("click", chg_page);

        return () => {
            albumSetElement.off("click", chg_page);
        };
    },[])

    return(
        <>
            <div className="circle_wrapper">
                <div className="circle"></div>
            </div>
        </>
    )
}
